import React from "react";
import ReactDOM from "react-dom";
import './Sidebar.scss'

function Sidebar(props, {toggle}) {
    console.log(toggle)
    const content = (
    <>
      <aside className={`side-drawer ${toggle}`} onClick={props.onClick}>
        {props.children}
      </aside>
    </>
  );
  return ReactDOM.createPortal(content, document.getElementById("drawer-hook"));
}

export default Sidebar;
